import React, { useEffect, useRef, useState } from "react";
import ValueServices from "../../services/ValueServices";
import {
  Autocomplete,
  Button,
  Card,
  CardContent,
  CircularProgress,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Select,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TablePagination,
  TableRow,
  TextField,
} from "@mui/material";
import { Box, Container } from "@mui/system";
import PerfectScrollbar from "react-perfect-scrollbar";
import {
  LayersControl,
  GeoJSON,
  MapContainer,
  TileLayer,
  FeatureGroup,
  Marker,
} from "react-leaflet";
import MarkerClusterGroup from "react-leaflet-markercluster";
import * as L from "leaflet";
import { DashboardLayout } from "../dashboard/dashboard-layout";
import "leaflet.markercluster/dist/MarkerCluster.css";
import "leaflet.markercluster/dist/MarkerCluster.Default.css";
import "leaflet/dist/leaflet.css";
import "leaflet-defaulticon-compatibility/dist/leaflet-defaulticon-compatibility.webpack.css"; // Re-uses images from ~leaflet package
import "leaflet-defaulticon-compatibility";
import AuthService from "../../services/auth.service";
import { useNavigate } from "react-router-dom";

const Map = () => {
  const navigate = useNavigate();

  // GEOJSON's
  const [ejes_calle, setEjes_calle] = useState("");
  const [contenidors, setContenidors] = useState(null);
  const [filteredContenidors, setFilteredContenidors] = useState([]);
  const [barrios, setBarrios] = useState([]);
  const [distritos, setDistritos] = useState([]);
  const [data, setData] = useState(null);
  const [map, setMap] = useState(null);

  // Valores desplegables
  const [tipoContenedores, setTipoContenedores] = useState([]);
  const [empresa, setEmpresa] = useState([]);
  const [productor, setProductor] = useState([]);
  const [modelo, setModelo] = useState([]);

  // Valores seleccionados
  const [tiposS, setTiposS] = useState([]);
  const [empresaS, setEmpresaS] = useState("");
  const [productorS, setProductorS] = useState("");
  const [modeloS, setModeloS] = useState("");
  const [distritoS, setDistritoS] = useState("");
  const [barriosS, setBarriosS] = useState("");
  const [coddistrit, setCoddistrit] = useState(0);

  const [geojsonKey, setgeojsonKey] = useState("");

  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(5);

  const geojsonRef = useRef();
  const barriosRef = useRef();
  const distritosRef = useRef();
  const mkRef = useRef();
  const divMapaRef = useRef();

  var bounds = [
    [39.64905472088473, -0.5623626708984375],
    [39.280636415076756, -0.19500732421874997],
  ];

  var modelosAuto = [];
  for (let index = 0; index < modelo.length; index++) {
    modelosAuto.push({
      label: modelo[index],
      id: index,
    });
  }
  var filtered = [];

  function handleChangePage(event, newPage) {
    setPage(newPage);
  }
  function handleChangeRowsPerPage(event) {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  }

  function onChangeDistrito(event) {
    console.log(event);
    console.log(event.target.value);
    console.log(event.target.id);
    console.log(event.target.name);
    setCoddistrit(event.props.id);
    setDistritoS(event.props.value);
    setBarriosS(null);
  }

  function onChangeBarrio(checked, event) {
    setCoddistrit(event.props.id);
    setBarriosS(event.props.value);
  }

  function calles(feature, layer) {
    layer.bindPopup(
      feature.properties.codtipovia + " " + feature.properties.nomoficial
    );
  }

  function popupBarrios(feature, layer) {
    layer.bindPopup(feature.properties.nombre);
  }

  function popupDistritos(feature, layer) {
    layer.bindPopup(feature.properties.nombre);
  }

  function contenedoresPopup(feature, layer) {
    layer.bindPopup(
      feature.properties.tipo_resid.toString() +
        " - " +
        feature.properties.empresa
    );
  }

  function filtroContenedores(feature, layer) {
    if (
      (tiposS.includes(feature.properties.tipo_resid) || tiposS.length === 0) &&
      (feature.properties.empresa === empresaS || empresaS === "") &&
      (feature.properties.productor === productorS || productorS === "") &&
      (feature.properties.modelo === modeloS || modeloS === "")
    ) {
      if (!filtered.includes(feature)) {
        filtered.push(feature);
      }
      return true;
    }
  }

  // Filtro para mostrar los distritos que cumplan la condición seleccionada
  function filtroDistritos(feature, layer) {
    return feature.properties.nombre === distritoS;
  }

  // Filtro para mostrar los barrios que cumplan la condición seleccionada
  function filtroBarrios(feature, layer) {
    return feature.properties.nombre === barriosS;
  }

  // Crear los puntos a partir de GeoJSON de contenedores
  function pointToLayer(feature, latlng) {
    return L.marker(latlng);
  }

  // Al pulsar el botón, a contenidors se le asigna data y cambia el valor de geojsonKey
  function buscar() {
    var json = {
      tipo_resid: tiposS,
      empresa: empresaS,
      productor: productorS,
      modelo: modeloS,
      distrito: coddistrit,
      barrio: barriosS,
    };

    ValueServices.getTest(json)
      .then((response) => {
        const data = JSON.parse(JSON.stringify(response.data));
        setContenidors(data);
      })
      .catch((error) => {
        console.log(error.message);
      });

    divMapaRef.current.scrollIntoView({ behavior: "smooth", block: "start" });
    setgeojsonKey(geojsonKey + 1);
  }

  // Al hacer click en un elemento de la lista zoom hasta el mismo
  function goToContenedor(e) {
    geojsonRef.current.eachLayer(function (layer) {
      if (layer.feature.properties.ogc_fid === e.properties.ogc_fid) {
        divMapaRef.current.scrollIntoView({
          behavior: "smooth",
          block: "start",
        });
        var coords = [e.geometry.coordinates[1], e.geometry.coordinates[0]];
        map.flyToBounds([coords, coords]);
        mkRef.current.zoomToShowLayer(layer, function () {
          layer.openPopup();
        });
      }
    });
  }

  useEffect(() => {
    if (contenidors) {
      map.flyToBounds(mkRef.current.getBounds());
    }
  }, [geojsonKey]);

  useEffect(() => {
    setgeojsonKey(geojsonKey + 1);
  }, [contenidors]);

  // Primer useEffect para recoger datos de la API
  useEffect(() => {
    if (AuthService.getCurrentUser()) {
      ValueServices.getAllGeometries()
        .then((response) => {
          const data = JSON.parse(JSON.stringify(response.data));
          setEjes_calle(data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getTipoContenidors()
        .then((response) => {
          setTipoContenedores(response.data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getEmpresa()
        .then((response) => {
          setEmpresa(response.data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getProductor()
        .then((response) => {
          setProductor(response.data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getModelo()
        .then((response) => {
          setModelo(response.data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getBarrios()
        .then((response) => {
          setBarrios(response.data);
        })
        .catch((error) => {
          console.log(error);
        });

      ValueServices.getDistritos()
        .then((response) => {
          setDistritos(response.data);
        })
        .catch((error) => {
          console.log(error);
        });
    } else {
      navigate("/login");
    }
  }, []);

  // Filtros de búsqueda
  function selects() {
    return (
      <>
        {" "}
        <Grid container spacing={2} sx={{ mb: 2 }}>
          <Grid item xs>
            <FormControl fullWidth>
              <InputLabel>Tipo contenedor: </InputLabel>
              <Select
                multiple
                value={tiposS}
                onChange={(e) => setTiposS(e.target.value)}
              >
                {tipoContenedores.map((tipo) => (
                  <MenuItem key={tipo} divider value={tipo}>
                    {tipo}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs>
            <FormControl fullWidth>
              <InputLabel>Empresa: </InputLabel>
              <Select onChange={(e) => setEmpresaS(e.target.value)}>
                {empresa.map((tipo) => (
                  <MenuItem key={tipo} divider value={tipo}>
                    {tipo}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs>
            <FormControl fullWidth>
              <InputLabel>Productor: </InputLabel>
              <Select onChange={(e) => setProductorS(e.target.value)}>
                {productor.map((productor) => (
                  <MenuItem key={productor} divider value={productor}>
                    {productor}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs>
            <FormControl fullWidth>
              <Autocomplete
                autoHighlight={false}
                options={modelosAuto}
                getOptionLabel={(option) => option.label}
                onChange={(e) => setModeloS(e.target.textContent)}
                renderInput={(params) => (
                  <TextField required {...params} label="Modelo:" />
                )}
              />
            </FormControl>
          </Grid>

          {distritos.features ? (
            <Grid item xs>
              <FormControl fullWidth>
                <InputLabel>Distritos </InputLabel>
                <Select onChange={(e) => onChangeDistrito(e)}>
                  {distritos.features.map((distrito) => {
                    // if para que no se repita distrito.properties.coddistrit
                    if (
                      !distritos.features.find(
                        (distrito2) =>
                          distrito2.properties.coddistrit ===
                          distrito.properties.coddistrit
                      )
                    )
                    
                      return (
                        <MenuItem
                          divider
                          id={distrito.properties.coddistrit}
                          value={distrito.properties.nombre}
                        >
                          {distrito.properties.nombre} -{" "}
                          {distrito.properties.coddistrit} -{" "}
                          {distrito.properties.ogc_fid}
                        </MenuItem>
                      );
                  })}
                </Select>
              </FormControl>
            </Grid>
          ) : (
            <></>
          )}

          {barrios.features ? (
            <Grid item xs>
              <FormControl disabled={!distritoS} fullWidth>
                <InputLabel>Barrios </InputLabel>
                <Select onChange={onChangeBarrio}>
                  {barrios.features.map((barrio) => {
                    if (
                      coddistrit === 0 ||
                      barrio.properties.coddistrit === coddistrit
                    )
                      return (
                        <MenuItem
                          divider
                          id={barrio.properties.coddistrit}
                          value={barrio.properties.nombre}
                        >
                          {barrio.properties.nombre}
                        </MenuItem>
                      );
                  })}
                </Select>
              </FormControl>
            </Grid>
          ) : (
            <></>
          )}
        </Grid>
        <Grid
          container
          spacing={0}
          direction="column"
          alignItems="center"
          justifyContent="center"
        >
          <Grid item xs>
            <Button onClick={(e) => buscar()} variant="contained">
              Buscar
            </Button>
          </Grid>
        </Grid>
      </>
    );
  }

  // Mapa con sus GeoJSON's
  function mapa() {
    if (!data) {
      return (
        <div ref={divMapaRef}>
          <MapContainer
            style={{ height: 600, width: "100%" }}
            className="Map"
            zoom={9}
            scrollWheelZoom={true}
            center={[39.47058066029149, -0.37831246400076907]}
            whenCreated={setMap}
          >
            <LayersControl>
              <LayersControl.BaseLayer checked name="OpenStreetMap">
                <TileLayer
                  attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                  url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                  maxZoom={19}
                />
              </LayersControl.BaseLayer>

              <LayersControl.Overlay name="Callesss">
                <GeoJSON
                  ref={distritosRef}
                  key={geojsonKey}
                  data={ejes_calle.features}
                  color="black"
                  weight={3}
                  onEachFeature={calles}
                />
              </LayersControl.Overlay>

              <LayersControl.BaseLayer name="OpenStreetMap FR">
                <TileLayer
                  attribution='&copy; OpenStreetMap France | &copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                  url="https://{s}.tile.openstreetmap.fr/osmfr/{z}/{x}/{y}.png"
                />
              </LayersControl.BaseLayer>

              {/* CALLES */}
            </LayersControl>

            <FeatureGroup>
              {/* DISTRITOS */}
              <GeoJSON
                ref={distritosRef}
                key={geojsonKey}
                data={distritos}
                color="blue"
                fillColor="lightblue"
                onEachFeature={popupDistritos}
                filter={filtroDistritos}
              />
            </FeatureGroup>

            <FeatureGroup>
              {/* BARRIOS */}
              <GeoJSON
                ref={barriosRef}
                key={geojsonKey}
                data={barrios}
                color="red"
                fillColor="lightred"
                onEachFeature={popupBarrios}
                filter={filtroBarrios}
              />
            </FeatureGroup>

            {/* <MarkerClusterGroup ref={mkRef}>
                        {contenidors ?
                            contenidors.map(contenidor => {
                                var temp = contenidor.wkb_geometry.slice(1, -1);
                                var coords = temp.split(",");
                                return (
                                    <Marker position={[coords[1], coords[0]]} />
                                )
                            })
                            : <>
                                <Marker position={[49.8397, 24.0297]} />
                                <Marker position={[52.2297, 21.0122]} />
                                <Marker position={[51.5074, -0.0901]} />
                            </>
                        }




                    </MarkerClusterGroup> */}

            <MarkerClusterGroup ref={mkRef} options={{ maxClusterRadius: 1 }}>
              <GeoJSON
                ref={geojsonRef}
                key={geojsonKey}
                data={contenidors}
                weight={3}
                pointToLayer={pointToLayer}
                onEachFeature={contenedoresPopup}
              />
            </MarkerClusterGroup>
          </MapContainer>
        </div>
      );
    } else {
      return (
        <Grid
          container
          spacing={0}
          direction="column"
          alignItems="center"
          justifyContent="center"
          sx={{ mb: 2, mt: 2 }}
        >
          <Grid item xs>
            <CircularProgress size={90} />
          </Grid>
        </Grid>
      );
    }
  }

  // Lista contenedores
  function lista() {
    return (
      <div>
        {" "}
        {!contenidors ? (
          <div>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell style={{ fontWeight: "bold" }}>
                      OGC_FID
                    </TableCell>
                    <TableCell style={{ fontWeight: "bold" }}>
                      EMPRESA
                    </TableCell>
                    <TableCell style={{ fontWeight: "bold" }}>CODVIA</TableCell>
                    <TableCell style={{ fontWeight: "bold" }}>
                      TIPO RESIDUO
                    </TableCell>
                    <TableCell style={{ fontWeight: "bold" }}>
                      PRODUCTOR
                    </TableCell>
                    <TableCell style={{ fontWeight: "bold" }}>MODELO</TableCell>
                    <TableCell></TableCell>
                  </TableRow>
                </TableHead>

                <TableBody>
                  {filteredContenidors
                    .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                    .map((contenidor, index) => {
                      return (
                        <TableRow key={contenidor.properties.ogc_fid}>
                          <TableCell>{contenidor.properties.ogc_fid}</TableCell>
                          <TableCell>{contenidor.properties.empresa}</TableCell>
                          <TableCell>{contenidor.properties.codvia}</TableCell>
                          <TableCell>
                            {contenidor.properties.tipo_resid}
                          </TableCell>
                          <TableCell>
                            {contenidor.properties.productor}
                          </TableCell>
                          <TableCell>{contenidor.properties.modelo}</TableCell>
                          <TableCell>
                            <Button onClick={(e) => goToContenedor(contenidor)}>
                              <svg
                                xmlns="http://www.w3.org/2000/svg"
                                width="16"
                                height="16"
                                fill="dark-grey"
                                viewBox="0 0 16 16"
                              >
                                <path d="M10.5 8a2.5 2.5 0 1 1-5 0 2.5 2.5 0 0 1 5 0z" />
                                <path d="M0 8s3-5.5 8-5.5S16 8 16 8s-3 5.5-8 5.5S0 8 0 8zm8 3.5a3.5 3.5 0 1 0 0-7 3.5 3.5 0 0 0 0 7z" />
                              </svg>
                            </Button>
                          </TableCell>
                        </TableRow>
                      );
                    })}
                </TableBody>
              </Table>
            </TableContainer>
            <TablePagination
              rowsPerPageOptions={[5, 10, 25, 200, filteredContenidors.length]}
              count={filteredContenidors.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onPageChange={handleChangePage}
              onRowsPerPageChange={handleChangeRowsPerPage}
            />
          </div>
        ) : (
          ""
        )}
      </div>
    );
  }

  return (
    <DashboardLayout>
      <Container maxWidth={false}>
        <div>
          <Card sx={{ mb: 2, mt: 2 }}>
            <CardContent>
              <Box>{selects()}</Box>
            </CardContent>
          </Card>

          <Card sx={{ mb: 2 }}>
            <PerfectScrollbar>
              <Box>{mapa()}</Box>
            </PerfectScrollbar>
          </Card>

          <Card sx={{ mb: 2 }}>
            <PerfectScrollbar>
              <Box>{lista()}</Box>
            </PerfectScrollbar>
          </Card>
        </div>
      </Container>
    </DashboardLayout>
  );
};
export default Map;
